import React, {useEffect, useState} from "react";

function SidaSammanlagdStats({patienter}) {
  const [currentAntalPatienter, setCurrentAntalPatienter] = useState(0);
  const [prevAntalPatienter, setPrevAntalPatienter] = useState(0);

  useEffect(() => {
    setCurrentAntalPatienter(patienter.length);
  }, [patienter]);

  // Använd en separat useEffect för att uppdatera 'prevAntalPatienter' när 'currentAntalPatienter' ändras.
  useEffect(() => {
    setPrevAntalPatienter(currentAntalPatienter);
  }, [currentAntalPatienter]);

  const okaAntal =
    currentAntalPatienter > prevAntalPatienter
      ? prevAntalPatienter + 1
      : prevAntalPatienter;
  return (
    <>
      <div className="tittel">
        <h1>Statistik filtrerad</h1>
      </div>
      <p>inskrivna: {okaAntal}</p>
    </>
  );
}

export default SidaSammanlagdStats;
